CREATE TABLE "DBA"."room" (
    "room_id"                        integer NOT NULL
   ,"host_id"                        integer NULL
   ,"room_type"                      varchar(255) NULL
   ,"country"                        varchar(255) NULL
   ,"city"                           varchar(255) NULL
   ,"neighborhood"                   varchar(255) NULL
   ,"address"                        varchar(1023) NULL
   ,"reviews"                        integer NULL
   ,"overall_satisfaction"           float NULL
   ,"accommodates"                   integer NULL
   ,"bedrooms"                       decimal(5,2) NULL
   ,"bathrooms"                      decimal(5,2) NULL
   ,"price"                          float NULL
   ,"deleted"                        integer NULL
   ,"minstay"                        integer NULL
   ,"last_modified"                  timestamp NULL DEFAULT current timestamp
   ,"latitude"                       numeric(30,6) NULL
   ,"longitude"                      numeric(30,6) NULL
   ,"survey_id"                      integer NOT NULL DEFAULT 999999
   ,"location"                       ST_Point(SRID=4326) NULL
   ,"location2228"                   ST_Point(SRID=2228) NULL
   ,"page"                           long varchar NULL
   ,PRIMARY KEY ("room_id" ASC,"survey_id" ASC) 
)
go

CREATE TABLE "DBA"."search_area" (
    "search_area_id"                 integer NOT NULL DEFAULT autoincrement
   ,"name"                           varchar(255) NULL DEFAULT 'UNKNOWN'
   ,PRIMARY KEY ("search_area_id" ASC) 
)
go

CREATE TABLE "DBA"."city" (
    "city_id"                        integer NOT NULL DEFAULT autoincrement
   ,"name"                           varchar(255) NULL
   ,"search_area_id"                 integer NULL
   ,PRIMARY KEY ("city_id" ASC) 
)
go

CREATE TABLE "DBA"."neighborhood" (
    "neighborhood_id"                integer NOT NULL DEFAULT autoincrement
   ,"name"                           varchar(255) NULL
   ,"search_area_id"                 integer NULL
   ,PRIMARY KEY ("neighborhood_id" ASC) 
)
go

CREATE TABLE "DBA"."survey" (
    "survey_id"                      integer NOT NULL DEFAULT autoincrement
   ,"survey_date"                    date NULL DEFAULT current date
   ,"survey_description"             varchar(255) NULL
   ,"search_area_id"                 integer NULL
   ,PRIMARY KEY ("survey_id" ASC) 
)
go

COMMENT ON TABLE "DBA"."survey" IS 
	'Each collection of rooms for a given city (search area) over a short period of time (usually a day) is called a survey. It''s a snapshot of the state of Airbnb listings in a particular place at a particular time.'
go

CREATE TABLE "DBA"."survey_search_page" (
    "survey_id"                      integer NOT NULL
   ,"room_type"                      varchar(255) NOT NULL
   ,"neighborhood_id"                integer NULL
   ,"page_number"                    integer NOT NULL
   ,"guests"                         integer NOT NULL
   ,"has_rooms"                      bit NULL
   ,"page_id"                        bigint NOT NULL DEFAULT autoincrement
   ,PRIMARY KEY ("page_id" ASC) 
)
go

COMMENT ON TABLE "DBA"."survey_search_page" IS 
	'This table tracks search progress during the first stage of a survey, to avoid going through all the rooms again and again. Once a survey is complete, the rows could be deleted for that survey.'
go

CREATE TABLE "DBA"."peers" (
    "id"                             integer NOT NULL
   ,"company"                        varchar(255) NULL
   ,"area"                           varchar(255) NULL
