    "max"("s"."survey_id") as "newer",
    "min"("s"."survey_id") as "older"
    from "DBA"."survey" as "s" join "DBA"."search_area" as "sa"
      on "s"."search_area_id" = "sa"."search_area_id"
    group by "city"
    having "count"() > 1
