create view "DBA"."survey_rating_distribution" /* view_column_name, ... */
  as select "survey_rating"."survey",
    "survey_rating"."city",
    "max"(if("survey_rating"."rating" is null) then "survey_rating"."n" else 0 endif) as "NULL",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 0) then "survey_rating"."n" else 0 endif) as "0",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = .5) then "survey_rating"."n" else 0 endif) as "0.5",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 1) then "survey_rating"."n" else 0 endif) as "1",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 1.5) then "survey_rating"."n" else 0 endif) as "1.5",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 2) then "survey_rating"."n" else 0 endif) as "2",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 2.5) then "survey_rating"."n" else 0 endif) as "2.5",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 3) then "survey_rating"."n" else 0 endif) as "3",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 3.5) then "survey_rating"."n" else 0 endif) as "3.5",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 4) then "survey_rating"."n" else 0 endif) as "4",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 4.5) then "survey_rating"."n" else 0 endif) as "4.5",
    "max"(if("survey_rating"."rating" is not null and "survey_rating"."rating" = 5) then "survey_rating"."n" else 0 endif) as "5"
    from "DBA"."survey_rating"
    group by "survey_rating"."survey","survey_rating"."city"
go

COMMENT TO PRESERVE FORMAT ON VIEW "DBA"."survey_rating_distribution" IS 
{create VIEW DBA."survey_rating_distribution"( /* view_column_name, ... */ )
AS
select survey,
    city,
    max(if (rating is null) then n else 0 endif ) "NULL",
    max(if (rating is not null and rating = 0) then n else 0 endif ) "0",
    max(if (rating is not null and rating = 0.5) then n else 0 endif ) "0.5",
    max(if (rating is not null and rating = 1) then n else 0 endif) "1",
    max(if (rating is not null and rating = 1.5) then n else 0 endif) "1.5",
    max(if (rating is not null and rating = 2) then n else 0 endif) "2",
    max(if (rating is not null and rating = 2.5) then n else 0 endif) "2.5",
    max(if (rating is not null and rating = 3) then n else 0 endif) "3",
    max(if (rating is not null and rating = 3.5) then n else 0 endif) "3.5",
    max(if (rating is not null and rating = 4) then n else 0 endif) "4",
    max(if (rating is not null and rating = 4.5) then n else 0 endif) "4.5",
    max(if (rating is not null and rating = 5) then n else 0 endif) "5"
from survey_rating
group by survey, city
}
go

