    "survey_rating_distribution"."0.5"+"survey_rating_distribution"."1"+"survey_rating_distribution"."1.5"+"survey_rating_distribution"."2"+"survey_rating_distribution"."2.5"+"survey_rating_distribution"."3"+"survey_rating_distribution"."3.5"+"survey_rating_distribution"."4"+"survey_rating_distribution"."4.5"+"survey_rating_distribution"."5"+"survey_rating_distribution"."NULL" as "total"
    from "DBA"."survey_rating_distribution"
go

COMMENT TO PRESERVE FORMAT ON VIEW "DBA"."survey_rating_distribution_2" IS 
{create VIEW DBA."survey_rating_distribution_2"( /* view_column_name, ... */ )
AS
select  survey,
        city,
        cast((100.*("0.5" + "1" + "1.5" + "2" + "2.5" + "3"))/total_non_null as decimal(5,1)) as "0-3",
        cast((100.*("3.5" + "4"))/total_non_null as decimal(5,1)) as "3.5-4",
