{create PROCEDURE DBA."room_by_review"(
    IN @review_count integer,
    IN @survey_id integer
)
RESULT( rooms int, total_rooms int, percent decimal(5,1)) 
BEGIN
	select count(*) rooms, 
    (select count(*) from survey_room(1)) total_rooms, 
    cast((100.0*rooms)/total_rooms as decimal(5,1)) as percent
    from survey_room(@survey_id)
    where reviews = @review_count
END
