create procedure "DBA"."lt_room"( in @search_area_id integer ) 
result( 
  "room_id" integer,
  "host_id" integer,
  "room_type" varchar(255),
  "country" varchar(255),
  "city" varchar(255),
  "neighborhood" varchar(255),
  "address" varchar(1023),
  "reviews" integer,
  "overall_satisfaction" real,
  "accommodates" integer,
  "bedrooms" decimal(5,2),
  "bathrooms" decimal(5,2),
  "price" real,
  "deleted" integer,
  "minstay" integer,
  "last_modified" timestamp,
  "latitude" numeric(30,6),
  "longitude" numeric(30,6),
  "survey_id" integer ) 
begin
  select "r"."room_id",
    "r"."host_id",
    "r"."room_type",
    "r"."country",
    "r"."city",
    "r"."neighborhood",
    "r"."address",
    "r"."reviews",
    "r"."overall_satisfaction",
    "r"."accommodates",
    "r"."bedrooms",
    "r"."bathrooms",
    "r"."price",
    "r"."deleted",
    "r"."minstay",
    "r"."last_modified",
    "r"."latitude",
    "r"."longitude",
    "r"."survey_id"
    from "room" as "r"
      join(select "room_id","max"("r"."survey_id") as "survey_id","count"() as "occurrences"
        from "room" as "r" join "survey" as "s" join "search_area" as "sa"
          on "r"."survey_id" = "s"."survey_id"
          and "s"."search_area_id" = "sa"."search_area_id"
          and "sa"."search_area_id" = @search_area_id
          and "deleted" = 0
        group by "room_id"
        having "occurrences" > 1) as "lt"
      on "r"."room_id" = "lt"."room_id"
      and "r"."survey_id" = "lt"."survey_id"
end
go

COMMENT ON PROCEDURE "DBA"."lt_room" IS 
	'room_ids that have been in multiple surveys, together with the most recent survey, for a given search area'
go

COMMENT TO PRESERVE FORMAT ON PROCEDURE "DBA"."lt_room" IS 
{create PROCEDURE DBA."lt_room"( IN @search_area_id integer )
result (
room_id int,
host_id int,
room_type varchar(255),
country VARCHAR (255),
city varchar(255),
neighborhood varchar(255),
address varchar(1023),
reviews int,
overall_satisfaction float,
accommodates int,
bedrooms decimal(5,2),
bathrooms decimal(5,2),
price float,
deleted int,
minstay int,
last_modified timestamp,
latitude numeric (30,6),
longitude numeric(30,6),
survey_id int
)
begin
    select r.room_id,
    r.host_id,
    r.room_type,
    r.country,
    r.city,
    r.neighborhood,
    r.address,
    r.reviews,
    r.overall_satisfaction,
    r.accommodates,   
    r.bedrooms,
    r.bathrooms,
    r.price,
    r.deleted,
    r.minstay,
    r.last_modified,
    r.latitude,
    r.longitude,
    r.survey_id 
    from room r join 
        (
        select room_id, max(r.survey_id) survey_id, count(*) occurrences
        from room r join survey s join search_area sa
        on r.survey_id = s.survey_id
        and s.search_area_id = sa.search_area_id
        and sa.search_area_id = @search_area_id
        and deleted = 0
        group by room_id
        having occurrences > 1
        ) lt
    on r.room_id = lt.room_id
    and r.survey_id = lt.survey_id
end
}
go

