create procedure "DBA"."survey_hosts"()
begin
  select "survey",
    "city",
    "count"() as "hosts",
    "sum"("rooms") as "listings",
    "sum"("rooms"*"multilister") as "multilister_listings",
    "sum"("revs") as "city_bookings",
    "sum"("revenue") as "city_income",
    cast((cast("sum"("revs"*"multilister") as real)/cast("city_bookings" as real)) as decimal(4,2)) as "fraction_multilister_bookings",
    cast("sum"("revenue"*"multilister")/"city_income" as decimal(4,2)) as "fraction_multilister_revenue",
    cast((cast("sum"("rooms"*"multilister") as real)/cast("listings" as real)) as decimal(4,2)) as "fraction_multilister_listings",
    cast((cast("sum"("multilister") as real)/cast("hosts" as real)) as decimal(4,2)) as "fraction_multilister_hosts"
    -- having revs > 0
    from(select "sa"."name" as "city",
        "s"."survey_id" as "survey",
        "r"."host_id",
        case when "count"() > 1.5 then 1 else 0 end as "multilister",
        "count"() as "rooms",
        "sum"("reviews") as "revs",
        "sum"("price"*"reviews") as "revenue"
        from "room" as "r" join "survey" as "s" join "search_area" as "sa"
          on "r"."survey_id" = "s"."survey_id"
          and "s"."search_area_id" = "sa"."search_area_id"
        where "deleted" = 0
        and "r"."price" is not null
        group by "city","survey","r"."host_id") as "t"
    group by "survey","city"
    order by "survey" asc
end
go

COMMENT ON PROCEDURE "DBA"."survey_hosts" IS 
	'List information about all hosts, grouped by survey'
go

COMMENT TO PRESERVE FORMAT ON PROCEDURE "DBA"."survey_hosts" IS 
{create procedure survey_hosts()
begin
    select survey, 
        city, 
        count(*) hosts, 
        sum(rooms) listings,
        sum(rooms*multilister) multilister_listings,
        sum(revs) city_bookings,
        sum(revenue) city_income,
        cast((cast(sum(revs*multilister) as float)/cast(city_bookings as float)) as decimal(4,2)) fraction_multilister_bookings,
        cast(sum(revenue*multilister)/city_income as decimal(4,2)) fraction_multilister_revenue,
        cast((cast(sum(rooms*multilister) as float)/cast(listings as float)) as decimal(4,2)) fraction_multilister_listings,
        cast((cast(sum(multilister) as float)/cast(hosts as float)) as decimal(4,2)) fraction_multilister_hosts
    from
    ( 
    select 
        sa.name city,
        s.survey_id survey,
        r.host_id,
        case when count(*) > 1.5 then 1 else 0 end multilister,
        count(*) rooms,
        sum(reviews) revs,
        sum(price*reviews) revenue
    from room r join survey s join search_area sa
    on r.survey_id = s.survey_id
    and s.search_area_id = sa.search_area_id
    where deleted = 0
    and r.price is not null
    group by city, survey, r.host_id
    -- having revs > 0
    ) t
    group by survey, city 
    order by survey
end
}
go

